import React from 'react';
import { SafeAreaView, Text, TextInput, TouchableOpacity, View, StyleSheet } from 'react-native';


export default function Information() {
  return (
    <SafeAreaView style={styles.container}>
          <Text style={styles.hey}>Hey,</Text>
          <Text style={styles.login}>Login Now.</Text>
        <View style={styles.create}>
          <Text>If you are new /</Text>
          <Text>Craete New</Text>
        </View>
        <View>
          <TextInput placeholder='Dstudio_agency' placeholderTextColor={'black'} />
        </View>
        <View>
          <TextInput placeholder='Password' />
        </View>
        <View>
          <Text>Forgot Passcode ?/</Text>
          <Text>Reset</Text>
        </View>
        <TouchableOpacity>
          <Text>Login</Text>
        </TouchableOpacity>
    </SafeAreaView>
  );
}


